values:
I went to the cape over the weekend and it was fun and I got tanned and burnt.. I miss so much of my friends.. I want to hang out guys.. I wont be so busy soon I love you.. I want copies of the pictures from the beach guys!!

I quit my job at the pharmacy.. no time and I will be way too busy if I keep it.. my last day is on Saturday.. it is sad but I hate it there.. too stressful.. and I dont make a lot..&nbsp;

Well call me sometime I miss you guys!!
